import React, { Component } from "react";
import "../Lounge/Lounge.scss";
import createHistory from "createbrowserhistory";

export default class Lounge extends Component {
  render() {
    componentDidMount();
    const history = createHistory();
    if (history.location.state && history.location.state.transaction) {
      let state = { ...history.location.state };
      delete state.transaction;
      history.replace({ ...history.location, state });
    }
    return (
      <div className="lounge">
        <p className="lounge__info">I am Lounge</p>
      </div>
    );
  }
}
